sprites.onOverlap(SpriteKind.Enemy, SpriteKind.Projectile, function (sprite, otherSprite) {
    sprite.destroy(effects.coolRadial, 200)
    info.changeScoreBy(1)
    remaining_enemy += -1
    if (remaining_enemy < 1) {
        current_level += 1
        new_level(current_level)
    }
})
